PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE image (image_id INTEGER PRIMARY KEY AUTOINCREMENT, images TEXT UNIQUE NOT NULL, caption TEXT);
CREATE TABLE event_type (event_type_id INTEGER PRIMARY KEY AUTOINCREMENT, event_types TEXT UNIQUE NOT NULL, built_in BOOLEAN NOT NULL DEFAULT 0, hidden BOOLEAN NOT NULL DEFAULT 0, couple BOOLEAN NOT NULL DEFAULT 0, after_death BOOLEAN NOT NULL DEFAULT 0, marital BOOLEAN NOT NULL DEFAULT 0);
CREATE TABLE kin_type (kin_type_id INTEGER PRIMARY KEY AUTOINCREMENT, kin_types TEXT UNIQUE NOT NULL, kin_code TEXT NOT NULL, hidden BOOLEAN NOT NULL DEFAULT 0);
CREATE TABLE name_type (name_type_id INTEGER PRIMARY KEY AUTOINCREMENT, name_types TEXT UNIQUE DEFAULT '', hierarchy INTEGER DEFAULT 999);
CREATE TABLE person (PERSON_ID integer primary key autoincrement, gender TEXT NOT NULL DEFAULT 'unknown');
CREATE TABLE role_type (
       role_type_id INTEGER PRIMARY KEY AUTOINCREMENT, 
       role_types TEXT UNIQUE NOT NULL, built_in BOOLEAN NOT NULL DEFAULT 0, hidden BOOLEAN NOT NULL DEFAULT 0);
CREATE TABLE IF NOT EXISTS "date_format" (date_format_id INTEGER PRIMARY KEY AUTOINCREMENT, date_formats TEXT NOT NULL DEFAULT 'alpha_dmy', abt TEXT NOT NULL DEFAULT 'abt', est TEXT NOT NULL DEFAULT 'est', cal TEXT NOT NULL DEFAULT 'calc', bef_aft TEXT NOT NULL DEFAULT 'bef/aft', bc_ad TEXT NOT NULL DEFAULT 'BCE/CE', os_ns TEXT NOT NULL DEFAULT 'OS/NS', span TEXT NOT NULL DEFAULT 'from_to', range TEXT NOT NULL DEFAULT 'btwn_&');
CREATE TABLE IF NOT EXISTS "place" (place_id INTEGER PRIMARY KEY AUTOINCREMENT, places TEXT NOT NULL, latitude TEXT DEFAULT '', longitude TEXT DEFAULT '', cartesian_coordinates TEXT DEFAULT '', township TEXT DEFAULT '', range TEXT DEFAULT '', section TEXT DEFAULT '', legal_subdivision TEXT DEFAULT '', hint TEXT UNIQUE DEFAULT null);
CREATE TABLE IF NOT EXISTS "color_scheme" (color_scheme_id INTEGER PRIMARY KEY AUTOINCREMENT, bg TEXT NOT NULL, highlight_bg TEXT NOT NULL, head_bg TEXT NOT NULL, fg TEXT NOT NULL, built_in BOOLEAN NOT NULL DEFAULT 1, hidden BOOLEAN NOT NULL DEFAULT 0);
CREATE TABLE IF NOT EXISTS "citation" (citation_id INTEGER PRIMARY KEY AUTOINCREMENT, source_id INTEGER NOT NULL, citations TEXT, FOREIGN KEY (source_id) REFERENCES source (source_id));
CREATE TABLE IF NOT EXISTS "claims_findings" (claims_findings_id INTEGER PRIMARY KEY AUTOINCREMENT, claim_id INTEGER NOT NULL, finding_id INTEGER NOT NULL, FOREIGN KEY (claim_id) REFERENCES claim (claim_id), FOREIGN KEY (finding_id) REFERENCES finding (finding_id));
CREATE TABLE IF NOT EXISTS "claims_notes" (claims_notes_id INTEGER PRIMARY KEY AUTOINCREMENT, claim_id INTEGER NOT NULL, note_id INTEGER NOT NULL, FOREIGN KEY (claim_id) REFERENCES claim (claim_id), FOREIGN KEY (note_id) REFERENCES note (note_id));
CREATE TABLE IF NOT EXISTS "claims_roles" (claims_roles_id INTEGER PRIMARY KEY AUTOINCREMENT, claim_id INTEGER NOT NULL, role_type_id INTEGER NOT NULL, person_id INTEGER NOT NULL, FOREIGN KEY (claim_id) REFERENCES claim (claim_id), FOREIGN KEY (role_type_id) REFERENCES role_type (role_type_id), FOREIGN KEY (person_id) REFERENCES person (person_id));
CREATE TABLE IF NOT EXISTS "current" (current_id INTEGER PRIMARY KEY AUTOINCREMENT, place_id INTEGER, person_id INTEGER, citation_id INTEGER REFERENCES citation (citation_id), color_scheme_id INTEGER DEFAULT null REFERENCES color_scheme (color_scheme_id), FOREIGN KEY (place_id) REFERENCES place (place_id), FOREIGN KEY (person_id) REFERENCES person (person_id));
CREATE TABLE IF NOT EXISTS "findings_roles" (findings_roles_id INTEGER PRIMARY KEY AUTOINCREMENT, finding_id INTEGER NOT NULL, role_type_id INTEGER NOT NULL, person_id INTEGER DEFAULT NULL, FOREIGN KEY (finding_id) REFERENCES finding (finding_id), FOREIGN KEY (role_type_id) REFERENCES role_type (role_type_id), FOREIGN KEY (person_id) REFERENCES person (person_id));
CREATE TABLE IF NOT EXISTS "places_places" (places_places_id INTEGER PRIMARY KEY AUTOINCREMENT, place_id1 INTEGER NOT NULL, place_id2 INTEGER DEFAULT NULL, period TEXT NOT NULL DEFAULT '', FOREIGN KEY (place_id1) REFERENCES place (place_id), FOREIGN KEY (place_id2) REFERENCES place (place_id));
CREATE TABLE IF NOT EXISTS "setting" (setting_id INTEGER PRIMARY KEY AUTOINCREMENT, image_male_id INTEGER, image_female_id INTEGER, image_unisex_id INTEGER, image_source_id INTEGER, image_place_id INTEGER, default_image_male_id INTEGER NOT NULL DEFAULT 17, default_image_female_id INTEGER NOT NULL DEFAULT 15, default_image_unisex_id INTEGER NOT NULL DEFAULT 14, default_image_source_id INTEGER NOT NULL DEFAULT 18, default_image_place_id INTEGER NOT NULL DEFAULT 19, FOREIGN KEY (image_male_id) REFERENCES image (image_id), FOREIGN KEY (image_female_id) REFERENCES image (image_id), FOREIGN KEY (image_unisex_id) REFERENCES image (image_id), FOREIGN KEY (image_source_id) REFERENCES image (image_id), FOREIGN KEY (image_place_id) REFERENCES image (image_id));
CREATE TABLE IF NOT EXISTS "findings_notes" (findings_notes_id INTEGER PRIMARY KEY AUTOINCREMENT, finding_id INTEGER NOT NULL, note_id INTEGER NOT NULL, topic_order INTEGER NOT NULL DEFAULT 0, FOREIGN KEY (finding_id) REFERENCES finding (finding_id), FOREIGN KEY (note_id) REFERENCES note (note_id));
CREATE TABLE IF NOT EXISTS "note" (note_id INTEGER PRIMARY KEY AUTOINCREMENT, notes TEXT NOT NULL DEFAULT '', private BOOLEAN NOT NULL DEFAULT 0, topic TEXT NOT NULL UNIQUE DEFAULT 'Note 1');
CREATE TABLE report_type (report_type_id INTEGER PRIMARY KEY AUTOINCREMENT, report_types TEXT NOT NULL DEFAULT '');
CREATE TABLE media_type (media_type_id INTEGER PRIMARY KEY AUTOINCREMENT, media_types TEXT NOT NULL DEFAULT '');
CREATE TABLE chart_type (chart_type_id INTEGER PRIMARY KEY AUTOINCREMENT, chart_types TEXT NOT NULL DEFAULT '');
CREATE TABLE project (project_id INTEGER PRIMARY KEY AUTOINCREMENT, projects TEXT NOT NULL DEFAULT '', project_summary TEXT);
CREATE TABLE to_do (to_do_id INTEGER PRIMARY KEY AUTOINCREMENT, to_dos TEXT NOT NULL DEFAULT '', priority INTEGER);
CREATE TABLE report (report_id INTEGER PRIMARY KEY AUTOINCREMENT, report_name TEXT NOT NULL DEFAULT '', report_type INTEGER, FOREIGN KEY (report_type) REFERENCES report_type (report_type_id));
CREATE TABLE media (media_id INTEGER PRIMARY KEY AUTOINCREMENT, media_name TEXT DEFAULT '', media_type INTEGER, FOREIGN KEY (media_type) REFERENCES media_type (media_type_id));
CREATE TABLE IF NOT EXISTS "images_elements" (images_elements_id INTEGER PRIMARY KEY AUTOINCREMENT, image_id INTEGER NOT NULL, main_image BOOLEAN NOT NULL DEFAULT 0, person_id INTEGER, place_id INTEGER, citation_id INTEGER, FOREIGN KEY (image_id) REFERENCES image (image_id), FOREIGN KEY (person_id) REFERENCES person (person_id), FOREIGN KEY (place_id) REFERENCES place (place_id), FOREIGN KEY (citation_id) REFERENCES citation (citation_id));
CREATE TABLE links_links (links_links_id INTEGER PRIMARY KEY AUTOINCREMENT, person_id INTEGER, places_places_id INTEGER, name_id INTEGER, source_id INTEGER, citation_id INTEGER, finding_id INTEGER, claim_id INTEGER, project_id INTEGER, to_do_id INTEGER, contact_id INTEGER, image_id INTEGER, note_id INTEGER, role_id INTEGER, repository_id INTEGER, report_id, INTEGER, chart_id INTEGER, media_id INTEGER, FOREIGN KEY (person_id) REFERENCES person (person_id), FOREIGN KEY (places_places_id) REFERENCES places_places (places_places_id), FOREIGN KEY (name_id) REFERENCES name (name_id), FOREIGN KEY (source_id) REFERENCES source (source_id), FOREIGN KEY (citation_id) REFERENCES citation (citation_id), FOREIGN KEY (finding_id) REFERENCES finding (finding_id), FOREIGN KEY (claim_id) REFERENCES claim (claim_id), FOREIGN KEY (project_id) REFERENCES project (project_id), FOREIGN KEY (to_do_id) REFERENCES to_do (to_do_id), FOREIGN KEY (contact_id) REFERENCES contact (contact_id), FOREIGN KEY (image_id) REFERENCES image (image_id), FOREIGN KEY (note_id) REFERENCES note (note_id), FOREIGN KEY (role_id) REFERENCES role (role_id), FOREIGN KEY (repository_id) REFERENCES repository (repository_id), FOREIGN KEY (report_id) REFERENCES report (report_id), FOREIGN KEY (chart_id) REFERENCES chart (chart_id), FOREIGN KEY (media_id) REFERENCES media (media_id));
CREATE TABLE IF NOT EXISTS "name" (name_id INTEGER PRIMARY KEY AUTOINCREMENT, person_id INTEGER NOT NULL, names TEXT NOT NULL, name_type_id INTEGER NOT NULL DEFAULT 18, sort_order TEXT NOT NULL, used_by TEXT NOT NULL DEFAULT '', FOREIGN KEY (person_id) REFERENCES person (person_id), FOREIGN KEY (name_type_id) REFERENCES name_type (name_type_id));
CREATE TABLE IF NOT EXISTS "finding" (finding_id INTEGER PRIMARY KEY AUTOINCREMENT, date TEXT NOT NULL DEFAULT '-0000-00-00-------', particulars TEXT NOT NULL DEFAULT '', age TEXT NOT NULL DEFAULT '', person_id INTEGER DEFAULT null, event_type_id INTEGER NOT NULL, date_sorter TEXT NOT NULL DEFAULT '0, 0, 0', age1 TEXT NOT NULL DEFAULT '', kin_type_id1 INTEGER, age2 TEXT NOT NULL DEFAULT '', kin_type_id2 INTEGER, person_id1 INTEGER DEFAULT null, person_id2 INTEGER DEFAULT null, nest0 INTEGER NOT NULL DEFAULT 1, nest1 INTEGER DEFAULT NULL, nest2 INTEGER DEFAULT NULL, nest3 INTEGER DEFAULT NULL, nest4 INTEGER DEFAULT NULL, nest5 INTEGER DEFAULT NULL, nest6 INTEGER DEFAULT NULL, nest7 INTEGER DEFAULT NULL, nest8 INTEGER DEFAULT NULL, FOREIGN KEY (person_id) REFERENCES person (person_id), FOREIGN KEY (event_type_id) REFERENCES event_type (event_type_id), FOREIGN KEY (kin_type_id1) REFERENCES kin_type (kin_type_id), FOREIGN KEY (kin_type_id2) REFERENCES kin_type (kin_type_id), FOREIGN KEY (person_id1) REFERENCES person (person_id), FOREIGN KEY (person_id2) REFERENCES person (person_id), FOREIGN KEY (nest0) REFERENCES place (place_id), FOREIGN KEY (nest1) REFERENCES place (place_id), FOREIGN KEY (nest2) REFERENCES place (place_id), FOREIGN KEY (nest3) REFERENCES place (place_id), FOREIGN KEY (nest4) REFERENCES place (place_id), FOREIGN KEY (nest5) REFERENCES place (place_id), FOREIGN KEY (nest6) REFERENCES place (place_id), FOREIGN KEY (nest7) REFERENCES place (place_id), FOREIGN KEY (nest8) REFERENCES place (place_id));
CREATE TABLE IF NOT EXISTS "format" (format_id INTEGER PRIMARY KEY AUTOINCREMENT, output_font TEXT, input_font TEXT, font_size INTEGER, default_output_font TEXT NOT NULL DEFAULT 'courier', default_input_font TEXT NOT NULL DEFAULT 'tahoma', default_font_size INTEGER NOT NULL DEFAULT 12);
CREATE TABLE sources_repositories (sources_repositories_id INTEGER PRIMARY KEY AUTOINCREMENT, source_id INTEGER NOT NULL, repository_id INTEGER NOT NULL, FOREIGN KEY (source_id) REFERENCES source (source_id), FOREIGN KEY (repository_id) REFERENCES repository (repository_id));
CREATE TABLE IF NOT EXISTS "claim" (claim_id INTEGER PRIMARY KEY AUTOINCREMENT, person_id INTEGER, event_type_id INTEGER, date TEXT NOT NULL DEFAULT '-0000-00-00-------', particulars TEXT NOT NULL DEFAULT '', age TEXT NOT NULL DEFAULT '', name_id INTEGER, surety FLOAT DEFAULT 3.0, nest0 INTEGER NOT NULL DEFAULT 1 REFERENCES place (place_id), nest1 INTEGER DEFAULT NULL REFERENCES place (place_id), nest2 INTEGER DEFAULT NULL REFERENCES place (place_id), nest3 INTEGER DEFAULT NULL REFERENCES place (place_id), nest4 INTEGER DEFAULT NULL REFERENCES place (place_id), nest5 INTEGER DEFAULT NULL REFERENCES place (place_id), nest6 INTEGER DEFAULT NULL REFERENCES place (place_id), nest7 INTEGER DEFAULT NULL REFERENCES place (place_id), nest8 INTEGER DEFAULT NULL REFERENCES place (place_id), FOREIGN KEY (person_id) REFERENCES person (person_id), FOREIGN KEY (event_type_id) REFERENCES event_type (event_type_id), FOREIGN KEY (name_id) REFERENCES name (name_id));
CREATE TABLE claims_citations (claims_citations_id INTEGER PRIMARY KEY AUTOINCREMENT, claim_id INTEGER NOT NULL, citation_id NOT NULL, FOREIGN KEY (claim_id) REFERENCES claim (claim_id), FOREIGN KEY (citation_id) REFERENCES citation (citation_id));
CREATE TABLE IF NOT EXISTS "contact" (contact_id INTEGER PRIMARY KEY AUTOINCREMENT, contact_name TEXT NOT NULL DEFAULT '', position TEXT NOT NULL DEFAULT '', company TEXT NOT NULL DEFAULT '', email TEXT NOT NULL default '', address TEXT NOT NULL DEFAULT '', phone TEXT NOT NULL DEFAULT '', cell TEXT NOT NULL DEFAULT '', website TEXT NOT NULL DEFAULT '', blog TEXT NOT NULL DEFAULT '', forum TEXT NOT NULL DEFAULT '', forum_handle TEXT NOT NULL DEFAULT '', ancestry_handle TEXT NOT NULL DEFAULT '', familysearch_handle TEXT NOT NULL DEFAULT '', findagrave_handle TEXT NOT NULL DEFAULT '', repository_id INTEGER, note_id INTEGER, dogs_name TEXT NOT NULL DEFAULT '', FOREIGN KEY (note_id) REFERENCES note (note_id), FOREIGN KEY (repository_id) REFERENCES repository (repository_id));
CREATE TABLE IF NOT EXISTS "repository" (repository_id INTEGER PRIMARY KEY AUTOINCREMENT, repository_name TEXT NOT NULL DEFAULT '');
CREATE TABLE IF NOT EXISTS "source" (source_id INTEGER PRIMARY KEY AUTOINCREMENT, sources TEXT NOT NULL);
CREATE TABLE date_change (date_change_id INTEGER PRIMARY KEY AUTOINCREMENT, date_changes TEXT NOT NULL, time_changes TEXT DEFAULT '', person_id INTEGER, source_id INTEGER, citation_id INTEGER, place_id INTEGER, note_id INTEGER, family_pointer TEXT DEFAULT null, FOREIGN KEY (person_id) REFERENCES person (person_id), FOREIGN KEY (source_id) REFERENCES source (source_id), FOREIGN KEY (place_id) REFERENCES place (place_id), FOREIGN KEY (note_id) REFERENCES note (note_id), FOREIGN KEY (citation_id) REFERENCES citation (citation_id));
DELETE FROM sqlite_sequence;
COMMIT;
