INSERT INTO note VALUES(1,replace('J. L. Grimaldo volunteered to lead the Salvation Army Band and carried out his  task with a fervor that was especially notable at Christmas time when he made special collections for the local orphanages.\n','\n',char(10)),0,'Philanthropy');
INSERT INTO note VALUES(2,replace('Jerry was a small, somewhat frail and very excitable man with an overabundance  of imagination and a tendency to overestimate his physical endurance. He would have fits of trembling whenever things didn''t go his way. During the Christmas season a note in the Personals column said only that he didn''t know when to come in out of the cold.\n','\n',char(10)),0,'Physical');
INSERT INTO note VALUES(3,replace('Jeremiah Grimaldo was able to play every instrument in the Salvation Army Band. It is said that sometimes he had to, because he was overqualified for the job and some amateur musicians found him hard to work with.\n','\n',char(10)),0,'Musical Ability');
INSERT INTO note VALUES(4,replace('While he was courting his future wife Ronnie Webb, she happened to mention that she''d always wanted to play the clarinet but found it impossible to learn. Jerry proclaimed that he could play several operas from memory on any instrument made, and ran out the door. He returned shortly with a clarinet and proceeded to impress Ronnie--who had already been deserted by a first husband--with his savantlike musical ability. But the demonstration was cut short when the police arrived, claiming the clarinet was stolen. Jerry insisted loudly that he had clearly informed the shopkeeper that he was only borrowing the instrument and would have it back forthwith. Nevertheless he was dragged kicking and screaming to the wagon and taken downtown, shouting hysterically the whole way and threatening the lives of his arresting officers, who gave him a good beating once out of sight inside the walls of the police station.\n\nThe incident was fueled by Jerry''s having recently pawned all his musical instruments in an attempt to prove to his heart-throb Ronnie that he could get a job doing normal work. He had already failed noisily at several job attempts when the clarinet-borrowing incident occurred.\n\nRonnie was known to freely offer the opinion that if she had not married Jerry, he would have been institutionalized. Since her first husband deserted her while Jerry was in prison, and Jerry still found ways to court her from prison, she finally gave in to his undying attention and they got married secretly the day her divorce from James was finalized.\n','\n',char(10)),0,'The Actual Crime');
INSERT INTO note VALUES(5,'When Jerry could not breathe well he became despondent because he could not play his beloved wind instruments anymore. His daughters report that he died of grief.',0,'Cause of Death');
INSERT INTO note VALUES(6,replace('Jeremiah Grimaldo and his wife-to-be Ronnie Webb practically lived together most of their lives. Ronnie was the daughter of the woman who fostered Jeremiah in Aspen, Colorado after he ran away from home at the age of 7.\n\nHowever, Ronnie was jealous of the attention her foster brother received and as a result she was not able to get along with her mother. She ended up living with neighbors throughout a large part of her childhood and teen years in order to avoid her mother and foster brother whose presence she could not tolerate.\n\nShe did however return home several times a week for piano lessons from her mother, who would not agree to the arrangement otherwise.\n\nWhen asked late in life why she detested her mother''s foster child so much and then married him, she stated that they''d been childhood sweethearts to anyone who could read between the lines, but his savantlike musical talent pleased her mother so much that Ronnie couldn''t stand the sight of either one of them. She said it was her bad experience with a completely non-musical first husband that straightened her out. She said that when she stopped comparing her considerable musical ability to Jerry''s monumental inborn talent, she realized she "actually liked him a little bit".\n','\n',char(10)),1,'Background');
INSERT INTO note VALUES(7,replace('Ronnie married her first husband briefly during a period of time when she was not getting along with her mother and never wanted to see another piano. The reason she gave was that James knew how to make money while Jeremiah (who didn''t stop courting her while he was in prison and she was still legally married to James) could only make noise.\n','\n',char(10)),0,'Reasons for Marriages');
INSERT INTO note VALUES(8,'Ronnie''s nickname ''Miss Polly Pianissimo'' was given to her by her husband who was small and frail but loud and opinionated. ''Miss Polly'' on the other hand was as quiet as a mouse. The longer she lived, the more beloved she was by her countless students and their families.',0,'Local Favorite');
INSERT INTO note VALUES(9,'Ronnie divorced her first husband soon after he went on a business trip back East and forgot to come home. In her divorce filing she stated that James only knew how to make money and his pronouncements of love for her had only been a lot of noise.',1,'Reasons for Divorce');
INSERT INTO note VALUES(10,replace('Outside of the abandoned logging barracks that Jeremiah and Ronnie made their home was their wagon, which bore a sign saying ''Grimaldo Music Academy''. Early in their career they decided to keep the wagon and mules at home during the winter months when they proved unable to keep the wagon on the road if there was a mud puddle anywhere in sight. During the summer months, the Grimaldos traveled extensively, offering music lessons on a wide range of instruments. One year they even carried a tiny piano on the wagon but they had to use more mules and couldn''t afford to keep them. During the other three seasons they rode the mules when possible to sell their services. Eventually they just stayed home as their musical academy become known and loved for miles around. Whenever the weather permitted, and sometimes when it didn''t, people of all ages would appear at the Grimaldo Music Academy hoping to trade a lesson for a sack of beans, a chicken leg or whatever they could trade.\n','\n',char(10)),0,'The J. L. Grimaldo Musical Academy');
INSERT INTO note VALUES(11,replace('Jerry became the foster child of his future mother-in-law when, as a runaway far from home, he saw a sign in her yard advertising piano lessons. When the filthy little ragamuffin pounded on her door, she thought he must be shaking from hunger, but he insisted that he just wanted a piano lesson so badly that he might fall down and die in her yard if she refused him. When she asked him to unwrap his bundle and saw a flute, a clarinet, and a trumpet, she reportedly told him he could not leave and he replied that he would die if she made him go back to Wyoming.\n','\n',char(10)),1,'Fostering');
INSERT INTO note VALUES(67,'As they grew older, Jerry and Ronnie took to spending the winter months in town where they ran the Salvation Army charities, performed at parties, and gave music lessons in their hotel room and at churches.',0,'Egbert, Wyoming');
