INSERT INTO note VALUES(187,'Jerry found religion while in prison and got stuck on one old gospel hymn, "I''ll Fly Away". He sang the song over and over non-stop for three days and refused to eat. The other prisoners begged for his release and to their surprise, the jailkeeper passed their request on to the right person and Jerry was sent home. Once he was safely out of prison, Jerry''s religious fervor quickly subsided.',0,'Out of Jail');
